DROP TABLE IF EXISTS `medical_documents`;
CREATE TABLE `medical_documents` (
  `id` int NOT NULL AUTO_INCREMENT,
  `student_id` int NOT NULL,
  `filename` varchar(255) NOT NULL,
  `file_data` longtext NOT NULL,
  `description` varchar(500) DEFAULT 'Medical Document',
  `uploaded_at` datetime DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `patient_id` (`student_id`),
  CONSTRAINT `medical_documents_ibfk_1` FOREIGN KEY (`student_id`) REFERENCES `students` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

