DROP TABLE IF EXISTS `medical_records`;
CREATE TABLE `medical_records` (
  `id` varchar(36) NOT NULL,
  `patientId` varchar(36) NOT NULL,
  `filename` varchar(255) NOT NULL,
  `fileType` varchar(50) NOT NULL,
  `fileData` longtext NOT NULL,
  `description` text,
  `uploadedAt` datetime DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `patientId` (`patientId`),
  CONSTRAINT `medical_records_ibfk_1` FOREIGN KEY (`patientId`) REFERENCES `users` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

DROP TABLE IF EXISTS `orders`;
CREATE TABLE `orders` (
  `id` varchar(36) NOT NULL,
  `userId` varchar(36) NOT NULL,
  `productType` enum('standard','premium') NOT NULL,
  `productName` varchar(255) NOT NULL,
  `price` varchar(20) NOT NULL,
  `customerName` varchar(255) NOT NULL,
  `phone` varchar(20) NOT NULL,
  `address` text NOT NULL,
  `quantity` int NOT NULL,
  `qrCode` varchar(36) DEFAULT NULL,
  `status` enum('pending','processing','shipped','delivered') DEFAULT 'pending',
  `orderDate` datetime DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `userId` (`userId`),
  KEY `qrCode` (`qrCode`),
  CONSTRAINT `orders_ibfk_1` FOREIGN KEY (`userId`) REFERENCES `users` (`id`),
  CONSTRAINT `orders_ibfk_2` FOREIGN KEY (`qrCode`) REFERENCES `qr_mappings` (`qrCode`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

DROP TABLE IF EXISTS `qr_mappings`;
CREATE TABLE `qr_mappings` (
  `id` varchar(36) NOT NULL,
  `patientId` varchar(36) NOT NULL,
  `qrCode` varchar(36) NOT NULL,
  `createdAt` datetime DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `qrCode` (`qrCode`),
  KEY `patientId` (`patientId`),
  CONSTRAINT `qr_mappings_ibfk_1` FOREIGN KEY (`patientId`) REFERENCES `users` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

DROP TABLE IF EXISTS `students`;
CREATE TABLE `students` (
  `id` int NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  `age` int NOT NULL,
  `email` varchar(255) NOT NULL,
  `password` varchar(255) NOT NULL,
  `blood_group` varchar(5) DEFAULT NULL,
  `allergies` text,
  `medical_conditions` text,
  `regular_medications` text,
  `address` text,
  `emergency_contacts` varchar(20) DEFAULT NULL,
  `student_class` varchar(10) DEFAULT NULL,
  `section` varchar(5) DEFAULT NULL,
  `roll_number` varchar(20) DEFAULT NULL,
  `parent_name` varchar(255) DEFAULT NULL,
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `email` (`email`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

